import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <TodoList/>
    </div>
  );
}
const TodoList=()=>{
  return (
  <div>
    <h3>What to learn</h3>
    <ul><input type="checkbox" checked={true}/><span>CSS & HTML</span></ul>
    <ul><input type="checkbox" checked={true}/><span>JavaScript</span></ul>
    <ul><input type="checkbox" checked={false}/><span>React</span></ul>
  </div>
  )
}
export default App;
